         setName(e.target.value);
        console.log("name",name);
    }
    const onChangeAge=(e)=>{
        setAge(e.target.value);
       console.log("age",age);
   }

    return (
        <div>
            name:<input type="text" value={name} onChange={onChangeName}/>
